var title_f36_1_36882="Endoclip polypec ulcer endo";
var content_f36_1_36882=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F75449&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F75449&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 542px\">",
"   <div class=\"ttl\">",
"    Endoclip placement at gastric polypectomy site",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 522px; height: 169px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A 52 year old male was referred for nausea and vomiting. After initial evaluation, an endoscopy was performed which revealed a 3cm long pedunculated gastric polyp. The polyp originated in the pre-pyloric region of the stomach and prolapsed through the pylorus into the duodenal bulb. The polyp was resected using a hot snare. After the resection, a large secondary ulcer exposing the submucosa remained. Though there was no active bleeding, two endoclips were placed to close the defect completely. The patient was placed on twice daily esomeprazole and was given instructions to avoid NSAIDS and aspirin. No bleeding or other complications were noted during follow up. The pathology showed that this was an inflammatory polyp with features of high grade dysplasia.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Ilseung Cho, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
