var title_f36_1_36891="Carb counting PI";
var content_f36_1_36891=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PI%2F73017&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PI%2F73017&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Carbohydrate counting: getting started",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Step 1: Know the goal",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Eating about the same amount of carbohydrate at meals and snacks each day will help to keep blood glucose levels from getting too high or too low.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Focus on keeping the amount of carbohydrate intake moderate to keep your blood glucose levels from going too high. Remember, it is not healthy to cut out all carbohydrate foods; the body, especially your brain, needs some every day.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Step 2: Monitoring intake and blood glucose",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Keeping a daily food and blood glucose record will help inform what affects blood glucose levels.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Measuring or weighing foods is helpful in the beginning to learn what common food portions look like.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Step 3: Methods of counting carbohydrate",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       To count carbohydrates, there are two methods. Patients may also blend the two methods.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       <strong>",
"        Read food labels:",
"       </strong>",
"       Look at the grams of total carbohydrate on the label. Remember, the nutrition information on food labels is for the standard serving size. If the portion is larger or smaller, it is necessary to adjust the carbohydrate information.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       <strong>",
"        Use the exchange system:",
"       </strong>",
"       Estimation of carbohydrate content can be broken down into food groups that are standardized for carbohydrate content according to particular portions. For example, one serving from the Bread/Starch, Fruit, or Milk group each contains between 12 and 15 grams of carbohydrate. Most vegetables do not contain a significant number of carbohydrates and do not need to be counted, although there are exceptions (eg, corn, potatoes).",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f36_1_36891=[""].join("\n");
