var title_f36_1_36892="Approach to establishing the cause of acute pancreatitis";
var content_f36_1_36892=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F76483&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F76483&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Approach to establishing the cause of acute pancreatitis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Clinical profile",
"       </td>",
"       <td class=\"subtitle1\">",
"        Suspected cause",
"       </td>",
"       <td class=\"subtitle1\">",
"        Confirmatory testing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Prior episodes of biliary colic and/or cholangitis, increased serum ALT and/or bilirubin during episode",
"       </td>",
"       <td>",
"        Gallstones",
"       </td>",
"       <td>",
"        Ultrasonography; ERCP/EUS/MRCP for common bile duct stones",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Long history (usually 10 to 20 years) of alcohol abuse",
"       </td>",
"       <td>",
"        Alcohol",
"       </td>",
"       <td>",
"        Plain film/CT scan for pancreatic calcification; blood glucose for diabetes; 72 hour fecal fat for steatorrhea; may require follow-up for definitive diagnosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        High-risk group on medication known to cause pancreatitis and no other cause for pancreatitis; eg, patient with AIDS on DDI, with Crohn's disease on 6-mercaptopurine, on ACE inhibitor with history of angioedema",
"       </td>",
"       <td>",
"        Drug-induced pancreatitis",
"       </td>",
"       <td>",
"        Withdrawal of offending drug",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Child with family history of pancreatitis",
"       </td>",
"       <td>",
"        Familial hypertriglyceridemia or hereditary chronic pancreatitis",
"       </td>",
"       <td>",
"        Serum triglyceride concentration and genetic testing, respectively",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Adult with milky serum",
"       </td>",
"       <td>",
"        Hypertriglyceridemia",
"       </td>",
"       <td>",
"        Serum triglyceride concentration",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Recent ERCP, surgery or abdominal trauma",
"       </td>",
"       <td>",
"        Posttraumatic/post procedure",
"       </td>",
"       <td>",
"        Temporal relationship to event",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hemorrhagic shock, recent vascular surgery, angiography, coronary artery bypass graft",
"       </td>",
"       <td>",
"        Vascular",
"       </td>",
"       <td>",
"        Temporal relationship to event; evidence of ischemic or atheroembolic injury to other organs; tissue biopsy may show evidence of atheroembolism and urine eosinophils",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Recurrent pancreatitis with hypercalcemia",
"       </td>",
"       <td>",
"        Hypercalcemia",
"       </td>",
"       <td>",
"        Hypercalcemia is an unusual cause of acute pancreatitis; exclude other causes first",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hypertension, proteinuria, mononeuropathy, skin lesions",
"       </td>",
"       <td>",
"        Polyarteritis nodosa",
"       </td>",
"       <td>",
"        Biopsy of muscle, skin or nerve, angiography, ANCA",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Recurrent pancreatitis without obvious cause (idiopathic)",
"       </td>",
"       <td>",
"        Pancreas divisum*",
"       </td>",
"       <td>",
"        ERCP shows pancreas divisum; endoscopic or surgical sphincterotomy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sphincter of Oddi dysfunction*",
"       </td>",
"       <td>",
"        ERCP with manometry/MRCP with secretin",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     ALT: alanine aminotransferase; ERCP: endoscopic retrograde cholangiopancreatography; EUS: endoscopic ultrasound; MRCP: magnetic resonance cholangiopancreatography; CT: computed tomography; DDI: didanosine; ACE: angiotensin converting enzyme; ANCA: antineutrophil cytoplasmic antibody.",
"     <br>",
"      * See topic review \"Etiology of acute pancreatitis\" for a discussion regarding the relation to etiology of pancreatitis.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f36_1_36892=[""].join("\n");
