var title_f36_1_36893="Etiology of macrocephaly by onset";
var content_f36_1_36893=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F74157&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F74157&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Common causes of macrocephaly in children according to time of clinical presentation",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td rowspan=\"10\">",
"        <strong>",
"         Early infantile (birth to 6 mo of age)",
"        </strong>",
"       </td>",
"       <td class=\"sublist1_start\" colspan=\"2\">",
"        Hydrocephalus (progressive or \"arrested\")",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Induction disorders",
"       </td>",
"       <td class=\"sublist_other\">",
"        Spina bifida cystica, cranium bifidum, Chiari malformations (types I, II, and III), aqueductal stenosis, holoprosencephaly",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Mass lesions",
"       </td>",
"       <td class=\"sublist_other\">",
"        Neoplasms, atrioventricular malformations, congenital cysts",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Intrauterine infections",
"       </td>",
"       <td class=\"sublist_other\">",
"        Toxoplasmosis, cytomegalic inclusion disease, syphilis, rubella",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Perinatal or postnatal infections",
"       </td>",
"       <td class=\"sublist_other\">",
"        Bacterial, granulomatous, parasitic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Perinatal or postnatal hemorrhage",
"       </td>",
"       <td class=\"sublist_other\">",
"        Hypoxia, vascular malformation, trauma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Hydranencephaly",
"       </td>",
"       <td class=\"sublist_other\">",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\" colspan=\"2\">",
"        Subdural effusion",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Hemorrhagic, infectious, cystic hygroma",
"       </td>",
"       <td class=\"sublist_other\">",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        Normal variant (often familial)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"16\">",
"        <strong>",
"         Late infantile (6 mo to 2 yr of age)",
"        </strong>",
"       </td>",
"       <td class=\"sublist1_start\" colspan=\"2\">",
"        Hydrocephalus (progressive or \"arrested\")",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Space-occupying lesions",
"       </td>",
"       <td class=\"sublist_other\">",
"        Tumors, cysts, abscess",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Postbacterial or granulomatous meningitis",
"       </td>",
"       <td class=\"sublist_other\">",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Posthemorrhagic",
"       </td>",
"       <td class=\"sublist_other\">",
"        Trauma or vascular malformation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        Dandy-Walker syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        Subdural effusion",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\" colspan=\"2\">",
"        Increased intracranial pressure syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Pseudotumor cerebri",
"       </td>",
"       <td class=\"sublist_other\">",
"        Lead, tetracycline, hypoparathyroidism, corticosteroids, excess or deficiency of vitamin A, cyanotic congenital heart disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\" colspan=\"2\">",
"        Primary skeletal cranial dysplasias (thickened or enlarged skull)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Osteogenesis imperfecta, hyperphosphatemia, osteopetrosis, rickets",
"       </td>",
"       <td class=\"sublist_other\">",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\" colspan=\"2\">",
"        Megalencephaly (increase in brain substance)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Metabolic central nervous system diseases",
"       </td>",
"       <td class=\"sublist_other\">",
"        Leukodystrophies (eg, Canavan, Alexander), lipidoses (Tay-Sachs), histiocytosis, mucopolysaccharidoses",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Proliferative neurocutaneous syndromes",
"       </td>",
"       <td class=\"sublist_other\">",
"        von Recklinghausen tuberous sclerosis, hemangiomatosis, Sturge-Weber",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Cerebral gigantism",
"       </td>",
"       <td class=\"sublist_other\">",
"        Sotos syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        Achondroplasia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Primary megalencephaly",
"       </td>",
"       <td>",
"        May be familial and unassociated with abnormalities of cellular architecture, or associated with abnormalities of cellular architecture",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"11\">",
"        <strong>",
"         Early to late childhood (older than 2 yr of age)",
"        </strong>",
"       </td>",
"       <td class=\"sublist1_start\" colspan=\"2\">",
"        Hydrocephalus (progressive or \"arrested\")",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Space-occupying lesions",
"       </td>",
"       <td class=\"sublist_other\">",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Preexisting induction disorder",
"       </td>",
"       <td class=\"sublist_other\">",
"        Aqueductal stenosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Postinfectious",
"       </td>",
"       <td class=\"sublist_other\">",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Hemorrhagic",
"       </td>",
"       <td class=\"sublist_other\">",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Chiari type I malformation",
"       </td>",
"       <td class=\"sublist_other\">",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\" colspan=\"2\">",
"        Megalencephaly",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Proliferative neurocutaneous syndromes",
"       </td>",
"       <td class=\"sublist_other\">",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Familial",
"       </td>",
"       <td class=\"sublist_other\">",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        Pseudotumor cerebri",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        Normal variant",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Child Neurology, 7th ed, Menkes JH, Sarnat HB, Maria BL (Eds), Lippincott Williams &amp; Wilkins, New York 2005. Copyright &copy; 2005 Lippincott Williams &amp; Wilkins.",
"    </div>",
"    <div class=\"contractual\">",
"     <br/>",
"     <a href=\"file://www.lww.com\">",
"      file://www.lww.com",
"     </a>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
